import React from 'react';
import styled from 'styled-components';
 
const ItemContainer = styled.div`
width: max-content;
height: max-content;

margin-top: 20px;
border-radius: 2px;
display: flex;
align-items: center;
flex-direction: column;
flex: 1;
width: 100%;
height: 100%;
`;
 
const TitlePane = styled.div`
    font-weight: 700;
    margin-bottom: 5px;
`;
 
const PricePane = styled.div`
    margin-bottom: 5px;
`;
 
function ListItem(props) {
    return (
        <ItemContainer>
            <TitlePane>Nome: {props.nome}</TitlePane>
            <PricePane>Ramal: {props.numero}</PricePane>
        </ItemContainer>
    );
}
 
export default ListItem;
